/** *	TplLoad navigator * *	@param container selector *	@param loadurl URL *	@param tpl template-index ***/ServiceClient.jquery.navigator.TplLoad = function(config){	return [{		service : ServiceClient.jquery.view.ElementView,		elementid : config.container	},{		service : ServiceClient.jquery.loader.AjaxLoader,		loadurl : config.loadurl,		workflow : [{			service : ServiceClient.jquery.renderer.TemplateUI,			template : ServiceClient.Registry.get(config.tpl)		}]	}];}